#include <fuzzer/FuzzedDataProvider.h>
#include "PDFDoc.h" // Include the header file for PDFDoc class
#include "OutputDev.h" // Include the header file for OutputDev class

#include <cstdint> // Include for uint8_t
#include <cstddef> // Include for size_t

extern "C" int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
    FuzzedDataProvider stream(data, size);

    // Initialize parameters for PDFDoc::displayPageSlice function
    OutputDev* outputDev = nullptr; // Initialize with a non-NULL value
    int param1 = stream.ConsumeIntegral<int>();
    double param2 = stream.ConsumeFloatingPoint<double>();
    double param3 = stream.ConsumeFloatingPoint<double>();
    int param4 = stream.ConsumeIntegral<int>();
    GBool param5 = stream.ConsumeBool();
    GBool param6 = stream.ConsumeBool();
    GBool param7 = stream.ConsumeBool();
    int param8 = stream.ConsumeIntegral<int>();
    int param9 = stream.ConsumeIntegral<int>();
    int param10 = stream.ConsumeIntegral<int>();
    int param11 = stream.ConsumeIntegral<int>(); // Fixed the missing closing angle bracket

    // Create an instance of PDFDoc class
    PDFDoc pdfDoc;

    // Call the function-under-test using the instance
    pdfDoc.displayPageSlice(outputDev, param1, param2, param3, param4, param5, param6, param7, param8, param9, param10, param11, nullptr, nullptr);

    return 0;
}
